window.bookSummaryJSON = "<p><b>\"I was nothing but a road to Midas. A means to get to where he wanted to go, and I paved that path in gold.\"</b></p> <p>My life has been made up of gilded lies. But death has been shaped from rot.</p> <p>Like a phoenix caught fire, I need to rise from the ashes and learn to wield my power. My wings may have been clipped, but I am not in a cage, and I'm finally free to fly from the frozen kingdoms I've been kept in.</p> <p>Yet the world doesn't want to let me.</p> <p>That's the thing when you turn against a kingâ€”everyone else turns against you. Good thing I have a different king in my corner. But even with the dark threat of Slade Ravinger, the other monarchs are coming for me.</p> <p>So I will fight for him and he will kill for me, and if we need to become the villains, then so be it. Because so long as I live in this world, I won't be used again.</p> <p><i>The BookTok hit Plated Prisoner series continues in book four. This dark adult fantasy romance is inspired by the myth of King Midas and the gold-touched woman who realizes her true worth. Intended for mature listeners.</i></p> <p><i>Newly recorded in duet-style narration by Lilly Drake and Anthony Palmini.</i></p>"; 
